import { useEffect, useState} from "react";
//import axios from "axios";


import "./App.css"


const App = () => {
  const [perguntas, setPerguntas] = useState([]);
console.log(perguntas)
  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch('/PerguntaSelecionadaPacientes');
      const data = await response.json();
      setPerguntas(data);
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Perguntas</h1>
      <ul>
        {perguntas.map((pergunta) => (
          <li key={pergunta._id}>{pergunta.pergunta}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
